import React, {Component} from 'react';
import {ListGroup, ListGroupItem} from 'reactstrap';
class Category extends Component {
    render() {
        return (
            <div className="category">
                <ListGroup>
                    <ListGroupItem className="items2"><a href="" className="links2">1</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">2</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">3</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">4</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">5</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">6</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">7</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">8</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">9</a></ListGroupItem>
                    <ListGroupItem className="items2"><a href="" className="links2">10</a></ListGroupItem>
                </ListGroup>
            </div>
        );
    }
}

export default Category;
